import styled from 'styled-components';

export const StyledToolBar = styled.div`
    position: absolute;
    top: 0px;
    right: 0px;
    padding: 10px;
    display: flex;
    flex-direction: row;
    justify-content: flex-end;
    align-items: center;
    width: 100vw;
    border-bottom: 1px solid #999;
`;
